import './currenttime.css'


const App = () => {

   
   
   let newTime = new Date().toLocaleTimeString();
     
   const [ctime, setCtime] = useState(newTime)
   return (
     <> 
      <h1>{ctime}</h1>
      <button>Get Time</button>
     </> 
   )
}
export default App;
